package com.market.pos.pojo;/** * 返回实体 */public class AskQQMessage {    private String act;    private String QQID;    private String msg;    private String QQName;    private String groupid;    private String duration;    public String getAct() {        return act;    }    public void setAct(String act) {        this.act = act;    }    public String getQQID() {        return QQID;    }    public void setQQID(String QQID) {        this.QQID = QQID;    }    public String getMsg() {        return msg;    }    public void setMsg(String msg) {        this.msg = msg;    }    public String getQQName() {        return QQName;    }    public void setQQName(String QQName) {        this.QQName = QQName;    }    public String getGroupid() {        return groupid;    }    public void setGroupid(String groupid) {        this.groupid = groupid;    }    public String getDuration() {        return duration;    }    public void setDuration(String duration) {        this.duration = duration;    }}